CREATE TABLE Dish
(id BIGINT,
name VARCHAR(1023),
description VARCHAR(1023),
menus_appeared BIGINT,
times_appeared BIGINT,
first_appeared BIGINT,
last_appeared BIGINT,
lowest_price DOUBLE,
highest_price DOUBLE);
CREATE TABLE Menu
(id BIGINT,
name VARCHAR(1023),
sponsor VARCHAR(1023),
event VARCHAR(1023),
venue VARCHAR(1023),
place VARCHAR(1023),
physical_description VARCHAR(1023),
occasion VARCHAR(1023),
notes VARCHAR(1023),
call_number VARCHAR(1023),
keywords VARCHAR(1023),
language VARCHAR(1023),
date DATE,
location VARCHAR(1023),
location_type VARCHAR(1023),
currency VARCHAR(1023),
currency_symbol VARCHAR(1023),
status VARCHAR(1023),
page_count BIGINT,
dish_count BIGINT);
CREATE TABLE MenuPage
(id BIGINT,
menu_id BIGINT,
page_number BIGINT,
image_id DOUBLE,
full_height BIGINT,
full_width BIGINT,
uuid VARCHAR(1023));
CREATE TABLE MenuItem
(id BIGINT,
menu_page_id BIGINT,
price DOUBLE,
high_price DOUBLE,
dish_id BIGINT,
created_at VARCHAR(1023),
updated_at VARCHAR(1023),
xpos DOUBLE,
ypos DOUBLE);
